class Solution(object):
    def countCornerRectangles(self, grid):

        count_rectangles=0
        num1=len(grid[0])
        num2=len(grid)

        for row in range(num2):
            indices=[i for i, x in enumerate(grid[row]) if x==1]

            #print indices
            for  deep_index ,column in enumerate(indices):
                for j in range(deep_index+1, len(indices)):
                    
                    
                    for row2 in range(row+1, num2):
                    	if grid[row2][indices[j]]:
                        	if grid[row2][column]:
                        		count_rectangles+=1

              


        return  count_rectangles

